import React from 'react';

export default function BlogPage(){
  return (
    <div className="container mx-auto px-4 py-12">
      <h1 className="text-3xl font-extrabold mb-4">சமீபத்திய கட்டுரைகள்</h1>
      <p className="text-gray-700">கட்டுரைகள் மற்றும் செய்திகள் விரைவில் இங்கே இடம் பெறும். (Placeholder)</p>
    </div>
  );
}
